  input: TEXT,F3XA,,"We receive a memo schedule from the DNC for the State Democratic
    Party Victory Fund on a Quarterly basis. The schedule covering this period was
    filed with our 2002 annual report. All of the funds transferred from the DSCC
    and the DCCC were used for Administartive activity, none was used for exempt activity.
    In January we transferred $55,704.85 which covered administrative activity in
    2001. This might make it appear that our transfers in 2002 were excessive, but
    they were not. Our 10/18 $68,982.20 transfer for ABS02 was 98% of the reported
    payments made on 9/6 & 9/19 totalling $ 70,390. Our 10/30 $ 34,626.48 transfer
    for ABS02 was 98% of the reported payments made on 10/1, 10/8, & 10/17 totalling
    $35,333.14. Our 10/31 $ 5,190.64 transfer for Trumbull 02G Ballot was 90% of the
    reported payments made on 10/9 & 10/17 totalling $ 5,767.38. Our 11/8 $ 586.36
    transfer for Trumbull 02G Ballot was 90% of the reported payment made on 11/8
    totalling $ 651.51. None of these transfers exceeded the non-federal share of
    joint disbursements and were within the 70 day window."
